import { RouterStateSerializer } from '@ngrx/router-store';
import { RouterStateSnapshot } from '@angular/router';
import { RouterStateModel } from './router.model';

/**
 * The RouterStateSerializer takes the current RouterStateSnapshot
 * and returns any pertinent information needed. The snapshot contains
 * all information about the state of the router at the given point in time.
 * The entire snapshot is complex and not always needed. In this case, you only
 * need the URL and query parameters from the snapshot in the store. Other items could be
 * returned such as route parameters and static route data.
 */

export class CustomRouterStateSerializer implements RouterStateSerializer<RouterStateModel> {
  serialize(routerState: RouterStateSnapshot): RouterStateModel {
    let route = routerState.root;

    while (route.firstChild) {
      route = route.firstChild;
    }

    const {
      url,
      root: { queryParams },
    } = routerState;
    const { params } = route;

    // Only return an object including the URL, params and query params
    // instead of the entire snapshot
    return { url, params, queryParams };
  }
}

import { ValidationErrors, FormGroup } from '@angular/forms';

export class FormValidators {

  /**
   * Form validators
   *
   * @example
   * this.form = this.formBuilder.group(
   *   {
   *     password: [null, Validators.required],
   *     confirmPassword: [null, [Validators.required]]
   *   },
   *   {
   *     validators: [FormValidators.mustMatch('password', 'confirmPassword')]
   *   }
   * );
   *
   * @param(string) controlName
   * @param(string) matchingControlName
   * @returns(ValidationErrors)
   */
  static mustMatch(controlName: string, matchingControlName: string): ValidationErrors | null {
    return (formGroup: FormGroup) => {
      const control = formGroup.controls[controlName];
      const matchingControl = formGroup.controls[matchingControlName];

      if (matchingControl.errors && !matchingControl.errors.mustMatch) {
        return;
      }

      if (control.value !== matchingControl.value) {
        matchingControl.setErrors({ mustMatch: true });
      } else {
        matchingControl.setErrors(null);
      }
    };
  }
}

export class LoggerService {

  /**
   * capture exception to logging platform
   *
   * @param(Error) error
   * @param() context
   */
  captureException(error: Error, context: any) {
    console.log('error: ', error);
    console.log('context: ', context);
    console.log('\n');
  }

  /**
   * capture info to logging platform
   *
   * @param(string) message
   * @param() tags
   */
  captureInfo(message: string, tags: any) {
    console.log('message: ', message);
    console.log('tags: ', tags);
    console.log('\n');
  }

}

import { HttpClient } from '@angular/common/http';
import { TranslateLoader } from '@ngx-translate/core';

import { Observable, forkJoin } from 'rxjs';
import { map } from 'rxjs/operators';
import * as _ from 'lodash';

export class MultiModuleTranslateLoader implements TranslateLoader {
  constructor(
    private http: HttpClient,
    private readonly options: {
      prefix: string;
      modules: Array<string>;
    }
  ) { }

  public getTranslation(lang: string): Observable<any> {
    const { prefix, modules } = this.options;

    const requests = modules.map((moduleName) => {
      const path = [prefix, moduleName, lang].join('/') + '.json';

      return this.http.get(path);
    });

    return forkJoin(requests).pipe(
      map(response => _.reduce(response, _.extend))
    );
  }
}

import * as Sentry from '@sentry/browser';

import { LoggerService } from './logger.service';
import { defaultSentryConfig } from './sentry.config';
import { loggerConfig } from './logger.config';

/**
 * A logger service implement use Sentry.io
 *
 * @link https://sentry.io
 * @link https://docs.sentry.io/
 * @author Luan Tran
 */
export class SentryService extends LoggerService {

  constructor() {
    super();
    this.initSentry();
  }

  initSentry() {
    Sentry.init({
      dsn: defaultSentryConfig.dsn,
      environment: defaultSentryConfig.environment,
      enabled: loggerConfig.enable,
      release: defaultSentryConfig.release
    });
  }

  captureException(error: Error, context: any) {
    if (!loggerConfig.enable) {
      return;
    }

    Sentry.withScope(scope => {
      scope.setContext(error.message, {
        ...context,
        level: Sentry.Severity.Error
      });
      Sentry.captureException(error);
    });
  }

  captureInfo(message: string, tags: any) {
    if (!loggerConfig.enable) {
      return;
    }

    Sentry.captureEvent({
      message,
      tags,
      level: Sentry.Severity.Info
    });
  }

}

